import * as React from 'react';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';


export default function outPut() {
    const AllTimeFile: string[] = ["a","b","c"];
    const AllMovieFile: string[] = ["a",",b","c"];
    const tutorial = "開始時間\nキーワード：\n区間毎の冒頭\nの順に表示されます。"

    const index: string[] = [
        "00:00:00~\nキーワード：a,b,c,d,e\n",
        "00:00:00~\nキーワード：a,b,c,d,e\n",
        "00:00:00~\nキーワード：a,b,c,d,e\n",
        "00:00:00~\nキーワード：a,b,c,d,e\n"
    ]

    return (
        <Box>
            <Box
                component="form"
                sx={{
                    '& .MuiTextField-root': { m: 1, width: '25ch' },
                }}
                noValidate
                autoComplete="off"
            >
                <div>
                    <TextField
                        id="outlined-select-currency"
                        select
                        label="your MovieFiles"
                        value="TimeFile"
                        helperText=""
                    >
                        {AllTimeFile.map((value) => (
                            <MenuItem key={value} value={value}>
                                {value}
                            </MenuItem>
                        ))}
                    </TextField>
                    <TextField
                        id="outlined-select-currency"
                        select
                        label="your TimeFiles"
                        value="MovieFile"
                        helperText=""
                    >
                        {AllMovieFile.map((value) => (
                            <MenuItem key={value} value={value}>
                            {value}
                            </MenuItem>
                        ))}
                    </TextField>
                </div>
            </Box>
            <Stack direction="row" spacing={2}>
                <Button 
                    variant="contained"
                >
                    作成
                </Button>
            </Stack>
        </Box>
    );
}
